import React from 'react';
import NavBar from "../navbar/NavBar";

interface IProps {
    heading: string
}

interface IState {
}

let MainHeader: React.FC<IProps> = ({heading}) => {
    return (
        <>
            <NavBar/>
            <div className="grid mt-3">
                <div className="container">
                    <div className="row">
                        <div className="col">
                            <p className="h3 text-dark">{heading}</p>
                            <p className="fst-italic">Lorem ipsum dolor sit amet, consectetur adipisicing elit.
                                Assumenda
                                beatae ea eos iusto, nesciunt quas quidem quisquam quo saepe tempora. Accusamus
                                doloribus
                                esse maxime. Aspernatur beatae debitis quas reprehenderit voluptates.</p>
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
};
export default MainHeader;
